an labels voor deze taxonomie. Standaard worden tag labels gebruikt voor niet-hiërarchische typen en categorielabels voor hiërarchische typen.<br /><br />Standaard: indien leeg, wordt <code>name</code> ingesteld op <code>label</code> waarde en <code>singular_name</code> wordt ingesteld op <code>name</code> waarde.','Designates the ascending or descending order of the <code>orderby</code> parameter in the admin list screen. Default: ASC.'=>'Geeft de oplopende of aflopende volgorde aan van de <code>orderby</code> parameter in het beheer lijstscherm. Standaard: ASC.','Sort retrieved terms by parameter in the admin list screen. Accepts term fields <code>name</code>, <code>slug</code>, <code>term_group</code>, <code>term_id</code>, <code>id</code>, <code>description</code>, <code>parent</code>, <code>count</code> (for term taxonomy count), or <code>none</code> to omit the ORDER BY clause'=>'Sorteer opgehaalde termen op parameter in het beheer lijstscherm. Accepteert term velden <code>name</code>, <code>slug</code>, <code>term_group</code>, <code>term_id</code>, <code>id</code>, <code>description</code>, <code>parent</code>, <code>count</code> (voor term taxonomie telling), of <code>none</code> om de ORDER BY clausule weg te laten','Number of terms to display on the admin list screen'=>'Aantal termen dat moet worden weergegeven op het beheer lijstscherm','Either hierarchical rewrite tag or not. Default: false.'=>'Hiërarchische herschrijf tag of niet. Standaard: false.','Allowing permalinks to be prepended with front base. Default: true.'=>'Staat toe dat permalinks worden voorgevoegd met de front base. Standaard: true.','Used as pretty permalink text (i.e. <code>/tag/</code>). Default: value of <code>name</code>'=>'Wordt gebruikt als mooie permalink tekst (bijv. <code>/tag/</code>). Standaard: waarde van <code>name</code>','Set to false to prevent automatic URL rewriting a.k.a. "pretty permalinks". Pass an argument array to override default URL settings for permalinks'=>'S