ociated <code>object_type</code>, such as post, is updated. Works much like a hook. Default: None.'=>'Een functienaam die wordt aangeroepen wanneer de telling van een geassocieerd <code>object_type</code>, zoals bericht, wordt geüpdatet. Werkt als een hook. Standaard: geen.','Whether the taxonomy is publicly queryable. Default: value of <code>public</code>'=>'Of de taxonomie openbaar opvraagbaar is. Standaard: waarde van <code>public</code>','Whether a taxonomy is intended for use publicly either via the admin interface or by front-end users. The default settings of <code>publicly_queryable</code>, <code>show_ui</code>, and <code>show_in_nav_menus</code> are inherited from <code>public</code>. Default: true.'=>'Of een taxonomie bedoeld is voor publiek gebruik via de beheerinterface of door front-end gebruikers. De standaardinstellingen van <code>publicly_queryable</code>, <code>show_ui</code> en <code>show_in_nav_menus</code> worden geërfd van <code>public</code>. Standaard: true.','The name of the object type for the taxonomy object. Object-types can be built-in Post Type or any Custom Post Type that may be registered. Default is None.'=>'De naam van het objecttype voor het taxonomie object. Objecttypen kunnen ingebouwde berichttypen zijn of elk extra berichttype dat kan worden geregistreerd. De standaardinstelling is none.','Is this taxonomy hierarchical (have descendants) like categories or not hierarchical like tags. Default: false'=>'Is deze taxonomie hiërarchisch (heeft afstammelingen) zoals categorieën of niet hiërarchisch zoals tags. Standaard: false','Include a description of the taxonomy'=>'Een beschrijving van de taxonomie opnemen','The name of the taxonomy. Name should only contain lowercase letters and the underscore character, and not be more than 32 characters long (database structure restriction)'=>'De naam van de taxonomie. De naam mag alleen kleine letters en het onderstrepingsteken bevatten en mag niet langer zijn dan 32 karakters (databasestructuur beperking)','Taxonomy'=>'Taxonomie','It is recommended to include this code within the <code>init</code> hook (<a href="%s" target="blank">see documentation</a>).'=>'Het wordt aanbevolen om deze code op te nemen in de <code>init</code> hook (<a href="%s" target="blank">zie documentatie</a> ).','%s post types exported'=>'%s berichttypen geëxporteerd','Post Type Label'=>'Berichttype label','New Post Type'=>'Nieuw berichttype','Edit Post Type'=>'Berichttype bewerken','An optional custom controller to use instead of <a href="https://developer.wordpress.org/reference/classes/wp_rest_posts_controller/" target="_blank">WP_REST_Posts_Controller</a>. Must be a subclass of <a href="https://developer.wordpress.org/reference/classes/wp_rest_controller/" target="_blank">WP_REST_Controller</a>. Default: <a href="https://developer.wordpress.org/reference/classes/wp_rest_posts_controller/" target="_blank">WP_REST_Posts_Controller</a>.'=>'Een optionele aangepaste controller om te gebruiken in plaats van <a href="https://developer.wordpress.org/reference/classes/wp_rest_posts_controller/" target="_blank">WP_REST_Posts_Controller</a>. Moet een subklasse zijn van <a href="https://developer.wordpress.org/reference/classes/wp_rest_controller/" target="_blank">WP_REST_Controller</a>. Standaard: <a href="https://developer.wordpress.org/reference/classes/wp_rest_posts_controller/" target="_blank">WP_REST_Posts_Controller</a>.','The base slug that this post type will use when accessed using the REST API: Default: <code>name</code>.'=>'De basis slug die dit berichttype zal gebruiken bij toegang via de REST API. Standaard: <code>name</code>.','Whether to expose this post type in the REST API. Must be true to enable the Gutenberg editor. Default: false.'=>'Of dit berichttype moet worden weergegeven in de REST API. Moet true zijn om de Gutenberg editor in te schakelen. Standaard: false.','Whether to use the internal default meta capability handling. Default: null.<br/><br/>If set it to false then standard admin role can\'t edit the posts types. Then the <code>edit_post</code> capability must be added to all roles to add or edit the posts types.'=>'Of de interne standaardverwerking van metarechten moet worden gebruikt. Standaard: null.<br/><br/>Als je dit op false zet, kan de standaard beheerdersrol de berichttypes niet bewerken. Dan moet het recht <code>edit_post</code> worden toegevoegd aan alle rollen om de berichttypes toe te voegen of te bewerken.','An array of the capabilities for this post type. Specify capabilities like this:<br /><br />edit_post : edit_book<br />read_post : read_book<br />delete_post : delete_book<br />edit_posts : edit_books<br />publish_posts : publish_books<br />etc...'=>'Een array met de rechten voor dit berichttype. Geef de rechten als volgt op:<br /><br />edit_post : edit_book<br />read_post : read_book<br />delete_post : delete_book<br />edit_posts : edit_books<br />publish_posts : publish_books<br />etc…','The string to use to build the read, edit, and delete capabilities.<br />May be passed as an array to allow for alternative plurals when using this argument as a base to construct the capabilities, like this:<br /><br />story<br />stories'=>'De string die wordt gebruikt om de lees-, bewerk- en verwijderrechten op te bouwen.<br />Mag worden doorgegeven als een array om alternatieve meervouden mogelijk te maken wanneer dit argument wordt gebruikt als basis om de rechten op te bouwen, zoals dit:<br /><br />verhaal<br />verhalen','Custom field type (NUMERIC, BINARY, CHAR, DATE, DATETIME, DECIMAL, SIGNED, TIME, UNSIGNED) used for the <code>orderby</code> parameter in the admin list screen'=>'Aangepast veldtype (NUMERIC, BINARY, CHAR, DATE, DATETIME, DECIMAL, SIGNED, TIME, UNSIGNED) gebruikt voor de <code>orderby</code> parameter in het beheer lijstscherm','Custom field used for the <code>orderby</code> parameter in the admin list screen'=>'Aangepast veld dat wordt gebruikt voor de parameter <code>orderby</code> in het beheer lijstscherm','Designates the ascending or descending order of the <code>orderby</code> parameter in the admin list screen. Default: DESC.'=>'Geeft de oplopende of aflopende volgorde aan van de <code>orderby</code> parameter in het beheer lijstscherm. Standaard: DESC.','Sort retrieved posts by parameter in the admin list screen. Default: date (<code>post_date</code>).'=>'Sorteer opgehaalde berichten op parameter in het beheerlijstscherm. Standaard: datum (<code>post_date</code>).','Number of posts to display on the admin list screen. Default: 10'=>'Aantal berichten dat moet worden weergegeven op het beheer lijstscherm. Standaard: 10','Add an "Archive" Options Page as submenu of the post type.'=>'Voeg een "Archief" optiepagina toe als submenu van het berichttype.','Should the permalink structure provide for pagination. Defaults to true.'=>'Of de permalink structuur paginering moet bieden. Standaard is true.','Should a feed permalink structure be built for this post type. Defaults to <code>has_archive</code> value.'=>'Moet er een feed permalink structuur worden gebouwd voor dit berichttype. Wordt standaard ingesteld op de <code>has_archive</code> waarde.','Should the permalink structure be prepended with the front base. (example: if your permalink structure is <code>/blog/</code>, then your links will be: false-><code>/news/</code>, true-><code>/blog/news/</code>). Defaults to true.'=>'Moet de permalink structuur worden voorafgegaan door de front base. (voorbeeld: als je permalink structuur <code>/blog/</code> is, dan zullen je links als volgt zijn: false-><code>/news/</code>, true-><code>/blog/news/</code>). Wordt standaard ingesteld op true.','Customize the permalink structure slug. Defaults to the <code>name</code> value. Should be translatable.'=>'Pas de slug van de permalink structuur aan. Wordt standaard ingesteld op de <code>name</code>. Moet vertaalbaar zijn.','Triggers the handling of rewrites for this post type. To prevent rewrites, set to false. Default: true and use <code>name</code> as slug'=>'Triggert de afhandeling van herschrijvingen voor dit berichttype. Stel in op false om herschrijven te voorkomen. Standaard: true en gebruik <code>name</code> als slug','Which template file to load for the single query. Default: <a href="https://developer.wordpress.org/themes/basics/template-hierarchy/" target="_blank">Template hierarchy</a>'=>'Welk template bestand moet worden geladen voor de enkele query. Standaard: <a href="https://developer.wordpress.org/themes/basics/template-hierarchy/" target="_blank">Template hiërarchie</a>','Custom field type (NUMERIC, BINARY, CHAR, DATE, DATETIME, DECIMAL, SIGNED, TIME, UNSIGNED) used for the <code>orderby</code> parameter in the archive page'=>'Aangepast veldtype (NUMERIC, BINARY, CHAR, DATE, DATETIME, DECIMAL, SIGNED, TIME, UNSIGNED) gebruikt voor de <code>orderby</code> parameter in de archiefpagina','Custom field used for the <code>orderby</code> parameter in the archive page'=>'Aangepast veld gebruikt voor de <code>orderby</code> parameter in de archiefpagina','Designates the ascending or descending order of the <code>orderby</code> parameter in the archive page. Default: DESC.'=>'Geeft de oplopende of aflopende rangschikking aan van de <code>orderby</code> parameter in de archiefpagina. Standaard: DESC.','Sort retrieved posts by parameter in the archive page. Default: date (<code>post_date</code>).'=>'Sorteer opgehaalde berichten op parameter in de archiefpagina. Standaard: datum (<code>post_date</code>).','Number of posts to display in the archive page. Default: 10'=>'Aantal berichten om weer te geven op de archiefpagina. Standaard: 10','Will use <code>name</code> as archive slug by default.'=>'Zal standaard <code>name</code> gebruiken als archief slug.','Enables post type archives. Default: false'=>'Schakelt archieven van berichttypes in. Standaard: false','Which template file to load for the archive query. Default: <a href="https://developer.wordpress.org/themes/basics/template-hierarchy/" target="_blank">Template hierarchy</a>'=>'Welk template bestand moet worden geladen voor de archief query. Standaard: <a href="https://developer.wordpress.org/themes/basics/template-hierarchy/" target="_blank">Template hiërarchie</a>','Whether to make this post type available in the WordPress admin bar. Default: value of <code>show_in_menu</code> argument'=>'Of dit berichttype beschikbaar moet zijn in de WordPress toolbar. Standaard: waarde van <code>show_in_menu</code> argument','Whether post_type is available for selection in navigation menus. Default: value of <code>public</code> argument'=>'Of post_type beschikbaar is voor selectie in navigatiemenu\'s. Standaard: waarde van <code>public</code> argument','If an existing top level page such as <code>tools.php</code> or <code>edit.php?post_type=page</code>, the post type will be placed as a sub menu of that.'=>'Als er een bestaande pagina op het hoogste niveau is, zoals <code>tools.php</code> of <code>edit.php?post_type=page</code>, dan wordt het berichttype als een submenu daarvan geplaatst.','Where to show the post type in the admin menu. <code>show_ui</code> must be true. Default: value of <code>show_ui</code> argument'=>'Waar het berichttype moet worden weergegeven in het beheermenu. <code>show_ui</code> moet true zijn. Standaard: waarde van <code>show_ui</code> argument','Whether to generate a default UI for managing this post type in the admin. Default: value of <code>public</code> argument'=>'Of er een standaard UI moet worden gegenereerd voor het beheer van dit berichttype in de beheeromgeving. Standaard: waarde van <code>public</code> argument','The url to the icon to be used for this menu or the name of the icon from the iconfont (<a href="https://developer.wordpress.org/resource/dashicons/" target="_blank">Dashicons</a>). Default: null – defaults to the posts icon.'=>'De URL naar het icoon dat moet worden gebruikt voor dit menu of de naam van het icoon uit het icoon lettertype (<a href="https://developer.wordpress.org/resource/dashicons/" target="_blank">Dashicons</a> ). Standaard: null - standaard het berichten icoon.','The position in the menu order the post type should appear. <code>show_in_menu</code> must be true. Default: null – defaults to below Comments.'=>'De positie in de menu rangschikking waar het berichttype moet verschijnen. <code>show_in_menu</code> moet true zijn. Standaard: null - staat standaard onder reacties.','Whether to delete posts of this type when deleting a user.<br/><br/>If true, posts of this type belonging to the user will be moved to trash when then user is deleted.<br/><br/>If false, posts of this type belonging to the user will not be trashed or deleted.<br/><br/>If not set (the default), posts are trashed if <code>post_type_supports(\'author\')</code>. Otherwise posts are not trashed or deleted. Default: null.'=>'Of berichten van dit type worden verwijderd als een gebruiker wordt verwijderd.<br/><br/>Wanneer true, worden berichten van dit type die bij de gebruiker horen naar de prullenbak verplaatst als de gebruiker wordt verwijderd.<br/><br/>Wanneer false, worden berichten van dit type die bij de gebruiker horen niet weggegooid of verwijderd.<br/><br/>Wannneer niet ingesteld (de standaardinstelling), worden berichten weggegooid wanneer <code>post_type_supports(\'author\')</code>. Anders worden berichten niet weggegooid of verwijderd. Standaard: null.','Can this post_type be exported. Default: true.'=>'Of dit post_type kan worden geëxporteerd. Standaard: true.','Whether queries can be performed on the front end as part of <code>parse_request()</code>. Default: value of <code>public</code> argument.'=>'Of query\'s kunnen worden uitgevoerd op de frontend als onderdeel van <code>parse_request()</code>. Standaard: waarde van <code>public</code> argument.','Whether to exclude posts with this post type from front end search results. Default: value of the opposite of <code>public</code> argument'=>'Of berichten met dit berichttype moeten worden uitgesloten van de zoekresultaten op de front-end. Standaard: waarde van het tegenovergestelde van het <code>public</code> argument','Controls how the type is visible to authors (<code>show_in_nav_menus</code>, <code>show_ui</code>) and readers (<code>exclude_from_search</code>, <code>publicly_queryable</code>). Default: false.'=>'Bepaalt hoe het type zichtbaar is voor auteurs (<code>show_in_nav_menus</code>, <code>show_ui</code>) en lezers (<code>exclude_from_search</code>, <code>publicly_queryable</code>). Standaard: false.','An array of taxonomy identifiers that will be registered for the post type. Taxonomies can be registered later with <a href="https://developer.wordpress.org/reference/functions/register_taxonomy/" target="_blank">register_taxonomy()</a> or <a href="https://developer.wordpress.org/reference/functions/register_taxonomy_for_object_type/" target="_blank">register_taxonomy_for_object_type()</a>.'=>'Een array van taxonomie identifiers die zullen worden geregistreerd voor het berichttype. Taxonomieën kunnen later worden geregistreerd met <a href="https://developer.wordpress.org/reference/functions/register_taxonomy/" target="_blank">register_taxonomy()</a> of <a href="https://developer.wordpress.org/reference/functions/register_taxonomy_for_object_type/" target="_blank">register_taxonomy_for_object_type()</a>.','Core feature(s) the post type supports. Serves as an alias for calling <a href="https://developer.wordpress.org/reference/functions/add_post_type_support/" target="_blank">add_post_type_support()</a> directly. Default is an array containing \'title\' and \'editor\'.'=>'Core functie(s) die het berichttype ondersteunt. Dient als alias voor het direct aanroepen van <a href="https://developer.wordpress.org/reference/functions/add_post_type_support/" target="_blank">add_post_type_support()</a>. Standaard is dit een array met \'title\' en \'editor\'.','Whether the post type is hierarchical (e.g. page). Allows Parent to be specified. The <code>supports</code> parameter should contain \'page-attributes\' to show the parent select box on the editor page. Default false.'=>'Of het berichttype hiërarchisch is (bijv. pagina). Staat toe dat hoofd wordt opgegeven. De <code>supports</code> parameter moet \'page-attributes\' bevatten om de hoofd selectiebox op de editorpagina weer te geven. Standaard false.','A short descriptive summary of what the post type is.'=>'Een korte beschrijvende samenvatting van wat het berichttype is.','Post type key. Must not exceed 20 characters and may only contain lowercase alphanumeric characters, dashes, and underscores. See <a href="https://developer.wordpress.org/reference/functions/sanitize_key/" target="_blank">sanitize_key()</a>.'=>'Berichttype sleutel. Mag niet langer zijn dan 20 tekens en mag alleen kleine alfanumerieke tekens, streepjes en underscores bevatten. Zie <a href="https://developer.wordpress.org/reference/functions/sanitize_key/" target="_blank">sanitize_key()</a>.','Post Type'=>'Berichttype','publish box time formatH:i'=>'H:i','publish box date formatM j, Y'=>'M j, Y','%1$s at %2$s'=>'%1$s om %2$s','Preview post'=>'Bericht bekijken','View post'=>'Bericht bekijken','Options Updated'=>'Opties geüpdatet','Options Page Title'=>'Instellingenpagina titel','New Options Page'=>'Nieuwe instellingenpagina','Edit Options Page'=>'Instellingenpagina bewerken','Options Pages'=>'Instellingenpagina','The message shown above the form on submit.'=>'Het bericht dat bij verzenden boven het formulier wordt weergegeven.','The update button text.'=>'De tekst van de updateknop.','Whether to load the option (values saved from this options page) when WordPress starts up. Defaults to false.'=>'Of de optie (opgeslagen waarden van deze optiepagina) geladen moet worden als WordPress opstart. Staat standaard op false.','The <code>$post_id</code> to save/load data to/from. Can be set to a numeric post ID (123), or a string (\'user_2\'). Defaults to \'options\'.'=>'De <code>$post_id</code> om gegevens van/naar op te slaan of laden. Kan worden ingesteld op een numerieke bericht ID (123) of een string (\'user_2\'). Staat standaard op \'options\'.','If set to true, this options page will redirect to the first child page (if a child page exists). If set to false, this parent page will appear alongside any child pages. Defaults to true'=>'Als dit is ingesteld op true, zal deze opties pagina doorsturen naar de eerste subpagina (als er een subpagina bestaat). Als dit is ingesteld op false, verschijnt deze hoofdpagina naast eventuele subpagina\'s. Standaard ingesteld op true','The icon class for this menu. Defaults to default WordPress gear.<br /><br />Read more about dashicons here: <a href="https://developer.wordpress.org/resource/dashicons/" target="_blank">https://developer.wordpress.org/resource/dashicons/</a>'=>'De pictogram klasse voor dit menu. Standaard ingesteld op het standaard WordPress tandwiel.<br /><br />Lees hier meer over dashicons: <a href="https://developer.wordpress.org/resource/dashicons/" target="_blank">https://developer.wordpress.org/resource/dashicons/</a>','The slug of another WP admin page. if set, this will become a child page.'=>'De slug van een andere WP beheerpagina. Wanneer ingesteld, wordt dit een subpagina.','The position in the menu order this menu should appear. Defaults to bottom of utility menu items.<br /><br />WARNING: if two menu items use the same position attribute, one of the items may be overwritten so that only one item displays!<br />Risk of conflict can be reduced by using decimal instead of integer values, e.g. 63.3 instead of 63.'=>'De positie in de menuvolgorde waar dit menu moet verschijnen. Staat standaard onderaan gereedschap menu-items.<br /><br />WAARSCHUWING: als twee menu-items hetzelfde positie attribuut gebruiken, kan een van de items worden overschreven zodat slechts één item wordt weergegeven!<br />Risico op conflicten kan worden verminderd door decimale waarden te gebruiken in plaats van gehele waarden, bijvoorbeeld 63,3 in plaats van 63.','The capability required for this menu to be displayed to the user. Defaults to edit_posts.<br /><br />Read more about capability here: <a href="https://wordpress.org/support/article/roles-and-capabilities/" target="_blank">https://wordpress.org/support/article/roles-and-capabilities/</a>'=>'De rechten die nodig zijn om dit menu weer te geven aan de gebruiker. Standaard ingesteld op edit_posts.<br /><br />Lees hier meer over de rechten: <a href="https://wordpress.org/support/article/roles-and-capabilities/" target="_blank">https://wordpress.org/support/article/roles-and-capabilities/</a>','The title displayed in the wp-admin sidebar. Defaults to Page Title'=>'De titel die wordt weergegeven in de wp-admin zijbalk. Standaard ingesteld op paginatitel','The URL slug used to uniquely identify this options page. Defaults to a url friendly version of Menu Title'=>'De URL slug die wordt gebruikt om deze opties pagina uniek te identificeren. Standaard een URL vriendelijke versie van menu titel','This block type already exists'=>'Dit bloktype bestaat al','It is recommended to include this code within the <code>acf/init</code> hook (<a href="%s" target="blank">see documentation</a>).'=>'Het wordt aanbevolen om deze code op te nemen in de <code>acf/init</code> hook (<a href="%s" target="blank">zie documentatie</a> ).','%s block types exported'=>'%s bloktypen geëxporteerd','Block Type Title'=>'Bloktype titel','New Block Type'=>'Nieuw bloktype','Edit Block Type'=>'Bloktype bewerken','A callback function that runs whenever your block is displayed (front-end and back-end) and enqueues scripts and/or styles.'=>'Een callback functie die wordt uitgevoerd wanneer je blok wordt weergegeven (front-end en back-end) en plaatst scripts en/of stijlen.','The url to a .js file to be enqueued whenever your block is displayed (front-end and back-end). This can either be a relative path to a file within the active theme, parent theme, wp-content directory or a full path to any file.'=>'De URL naar een .JS bestand dat moet worden aangemaakt wanneer je blok wordt weergegeven (front-end en back-end). Dit kan een relatief pad zijn naar een bestand in het actieve thema, hoofdthema, de wp-content folder of een volledig pad naar een bestand.','The url to a .css file to be enqueued whenever your block is displayed (front-end and back-end). This can either be a relative path to a file within the active theme, parent theme, wp-content directory or a full path to any file.'=>'De URL naar een .CSS bestand dat moet worden aangemaakt wanneer je blok wordt weergegeven (front-end en back-end). Dit kan een relatief pad zijn naar een bestand in het actieve thema, hoofdthema, de wp-content folder of een volledig pad naar een bestand.','Instead of providing a render_template, a callback function name may be specified to output the block\'s HTML.'=>'In plaats van een render_template op te geven, kan een callback functienaam worden opgegeven om de blok HTML uit te voeren.','The path to a template file used to render the block HTML. This can either be a relative path to a file within the active theme, parent theme, wp-content directory or a full path to any file.'=>'Het pad naar een template bestand dat gebruikt wordt om de blok HTML te renderen. Dit kan een relatief pad zijn naar een bestand in het actieve thema, hoofdthema, de wp-content folder of een volledig pad naar een bestand.','Specifying a dashicon for the block'=>'Specificeert een dashicon voor het blok','Specifying a color for the icon (optional: if not set, a readable color will be automatically defined)'=>'Een kleur opgeven voor het icoon (optioneel: wanneer niet ingesteld, wordt automatisch een leesbare kleur gedefinieerd)','Specifying a background color to appear with the icon e.g.: in the inserter.'=>'Een achtergrondkleur opgeven die bij het icoon moet verschijnen, bijvoorbeeld: in de invoegtoepassing.','An icon property can be specified to make it easier to identify a block. These can be any of WordPress’ Dashicons, or a custom svg element.'=>'Er kan een icoon eigenschap worden opgegeven om het gemakkelijker te maken om een blok te identificeren. Dit kan een van de WordPress Dashicons zijn, of een eigen SVG element.','Simple: Specify a Dashicons class or SVG path<br />Colors: Specify colors & Dashicons class'=>'Eenvoudig: geef een Dashicons klasse of SVG pad op<br />Kleuren: geef kleuren & Dashicons klasse op','This property allows the block to be added multiple times. Defaults to true.'=>'Deze eigenschap geeft de mogelijkheid om het blok meerdere keren toe te voegen. Standaard is true.','This property allows the user to toggle between edit and preview modes via a button. Defaults to true.'=>'Met deze eigenschap kan de gebruiker via een knop togglen tussen de bewerkings- en voorbeeldmodus. Standaard is true.','This property enables the full height button on the toolbar of a block'=>'Deze eigenschap schakelt de knop op volledige hoogte in op de toolbar van een blok','This property enables a toolbar button to control the block’s inner content alignment. Defaults to false. Set to true to show the alignment toolbar button, or set to "matrix" to enable the full alignment matrix in the toolbar'=>'Met deze eigenschap kan een toolbar knop de uitlijning van de inhoud van het blok bepalen. Standaard ingesteld op false. Stel in op true om de uitlijning toolbar knop te tonen, of stel in op "matrix" om de volledige uitlijningsmatrix in de toolbar te activeren','This property enables a toolbar button to control the block’s text alignment. Defaults to false. Set to true to show the alignment toolbar button.'=>'Met deze eigenschap kan een toolbar knop de tekstuitlijning van het blok regelen. Standaard ingesteld op false. Stel in op true om de uitlijning toolbar knop te tonen.','Set to an array of specific alignment names to customize the toolbar.<br />One line for each name. ie:<br /><br />left<br />right<br />full'=>'Stel in op een array van specifieke uitlijningsnamen om de toolbar aan te passen.<br />Eén regel voor elke naam. Bijvoorbeeld:<br /><br />links<br />rechts<br />volledig','This property adds block controls which allow the user to change the block’s alignment. Defaults to true. Set to false to hide the alignment toolbar. Set to an array of specific alignment names to customize the toolbar.'=>'Deze eigenschap voegt blok besturingen toe waarmee de gebruiker de uitlijning van het blok kan wijzigen. Standaard ingesteld op true. Stel in op false om de uitlijning toolbar te verbergen. Stel in op een array van specifieke uitlijningsnamen om de toolbar aan te passen.','Parse the block HTML as JSX for the Inner Block Component to function within the React based block editor.'=>'Parse de blok HTML als JSX om het binnenste blok component te laten functioneren binnen de React gebaseerde blok-editor.','Enable Anchor attribute. Defaults to false'=>'Anker attribuut inschakelen. Standaard op false','The default block content alignment (see supports setting for more info). Available settings are "top", "center" and "bottom".<br /><br />When utilising the "Matrix" control type, additional settings are available to specify all 9 positions from “top left” to “bottom right”. Defaults to "top".'=>'De standaard blok inhouds uitlijning (zie ondersteuningsinstellingen voor meer informatie). Beschikbare instellingen zijn "boven", "midden" en "onder".<br /><br />Bij het gebruik van het "Matrix" controle type, zijn er aanvullende instellingen beschikbaar om alle 9 posities van "linksboven" tot "rechtsonder" te specificeren. Standaard ingesteld op "boven".','The default block text alignment (see supports setting for more info). Available settings are "left", "center" and "right". Defaults to the current language\'s text alignment.'=>'De standaard blok tekstuitlijning (zie ondersteunende instellingen voor meer informatie). Beschikbare instellingen zijn "links", "midden" en "rechts". Standaard ingesteld op de tekstuitlijning van de huidige taal.','The default block alignment. Available settings are "left", "center", "right", "wide" and "full". Defaults to an empty string.'=>'De standaard blokuitlijning. Beschikbare instellingen zijn "links", "midden", "rechts", "breed" en "volledig". Standaard ingesteld op een lege string.','The display mode for your block. Available settings are "auto", "preview" and "edit". Defaults to "preview".<br /><br /><strong>Preview</strong>: Preview is always shown. Edit form appears in sidebar when block is selected.<br /><strong>Auto</strong>: Preview is shown by default but changes to edit form when block is selected.<br /><strong>Edit</strong>: Edit form is always shown.<br /><br />Note. When in "preview" or "edit" modes, an icon will appear in the block toolbar to toggle between modes.'=>'De weergavemodus voor je blok. Beschikbare instellingen zijn "auto", "voorbeeld" en "bewerken". Standaard ingesteld op "voorbeeld".<br /><br /><strong>Voorbeeld</strong>: Het voorbeeld wordt altijd weergegeven. Het bewerkingsformulier verschijnt in de zijbalk wanneer het blok is geselecteerd.<br /><strong>Auto</strong>: Het voorbeeld wordt standaard weergegeven, maar verandert in het bewerkingsformulier wanneer het blok is geselecteerd.<br /><strong>Bewerken</strong>: Het bewerkingsformulier wordt altijd weergegeven.<br /><br />Let op. Wanneer je in de modi "voorbeeld" of "bewerken" bent, verschijnt er een pictogram in de blok toolbar om tussen de modi te togglen','An array of post types to restrict this block type to.'=>'Een array van berichttypes om dit bloktype tot te beperken.','An array of search terms to help user discover the block while searching.<br />One line for each keyword. ie:<br /><br />quote<br />mention<br />cite'=>'Een array van zoektermen om het blok te helpen ontdekken tijdens het zoeken.<br />Eén regel voor elk keywoord. bijvoorbeeld:<br /><br />citaat<br />vermelding<br />citeer','Blocks are grouped into categories to help users browse and discover them. The core provided categories are [ common | formatting | layout | widgets | embed ]. Plugins and Themes can also register custom block categories.<br /><br />Plugins and Themes can also register <a href="https://developer.wordpress.org/block-editor/reference-guides/filters/block-filters/#managing-block-categories" target="_blank">custom block categories</a>.'=>'Blokken zijn gegroepeerd in categorieën om gebruikers te helpen ze te doorzoeken en te ontdekken. De core categorieën zijn [ algemeen | opmaak | lay-out | widgets | insluiten ]. Plugins en thema\'s kunnen ook aangepaste blokcategorieën registreren.<br /><br />Plugins en thema\'s kunnen ook <a href="https://developer.wordpress.org/block-editor/reference-guides/filters/block-filters/#managing-block-categories" target="_blank">aangepaste blok categorieën</a> registreren.','This is a short description for your block.'=>'Dit is een korte beschrijving van je blok.','A unique name that identifies the block (without namespace).<br />Note: A block name can only contain lowercase alphanumeric characters and dashes, and must begin with a letter.'=>'Een unieke naam die het blok identificeert (zonder namespace).<br />Let op: een bloknaam kan alleen kleine alfanumerieke tekens en streepjes bevatten, en moet beginnen met een letter.','Reset'=>'Resetten','copy'=>'kopiëren','%s draft updated.'=>'%s concept geüpdatet.','%s scheduled.'=>'%s gepland.','%s submitted.'=>'%s verzonden.','%s saved.'=>'%s opgeslagen.','%s published.'=>'%s gepubliceerd.','%s deleted.'=>'%s verwijderd.','%s updated.'=>'%s geüpdatet.','Export'=>'Exporteren','%s value is required'=>'%s waarde is vereist','You can copy and paste the following code to your theme\'s <code>functions.php</code> file or include it within an external file.'=>'Je kunt de volgende code kopiëren en plakken in het <code>functions.php</code> bestand van je thema of het opnemen in een extern bestand.','Archives'=>'Archieven','Above fields'=>'Boven velden','Toolt